const fieldSizeInches = 144;
const fieldImagePixels = 600;
const scale = fieldSizeInches / fieldImagePixels;

const styles = {
  pathlines: {
    width: fieldImagePixels,
    height: fieldImagePixels,
    position: "absolute",
    inset: 0,
    pointerEvents: "none",
    zIndex: 0,
  },
};
